import logo from "../img/world-icon.png"
import "../styles/Navbar.css"

function Navbar() {
    return (
        <div className="Navbar">
            <img src={logo} className="nav-logo" alt="world icon" />
            <h1 className="navbar-text">Travel Project Tekrar</h1>
        </div>
    )
}

export default Navbar
